import React from 'react';

const About = () => {
    return (
        <>
            <h1>About Coming Soon....</h1>
            <p>Electric vehicles (EVs) are automobiles that are powered by electric motors using electrical energy stored in rechargeable batteries. They produce zero tailpipe emissions, helping to reduce environmental pollution and combat climate change.</p>
        </>
    )
}
export default About;
